import React from "react";
import ProjectContent from "./projectcontent/projectContent";

class Content extends React.Component {
    render() {
        return(
            <div className="contentContainer">
                <div className="contentItem">
                    <ProjectContent/>
                </div>
            </div>
        )
    }
}

export default Content;
